import axios from 'axios';

export const registerUser = async (formValue) => {
  try {
    const response = await axios.post('/register', formValue);
    return response.data;
  } catch (error) {
    throw error.response.data; // Hoặc xử lý lỗi theo cách bạn muốn
  }
};
